import "./App.css";
import Navbar from "./components/Navbar";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import DashBoard from "./screen/DashBoard";
function App() {
  return (
    <div className="App">
      <Navbar />
      <Router>
        <Route path="/home" component={DashBoard} />
        <Route path="/login" />
        <Route path="/register" />
        <Route path="/admin" />
      </Router>
    </div>
  );
}

export default App;
